import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Login from './components/Login';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/login" element={<Login />} />
        <Route path="/" element={
          <div style={styles.container}>
            <h1 style={styles.title}>Coach Tyron</h1>
            <button 
              style={styles.button}
              onClick={() => alert('Welcome to Coach Tyron!')}
            >
              <span style={styles.buttonText}>Get Started</span>
            </button>
          </div>
        } />
      </Routes>
    </Router>
  );
}

const styles = {
  container: {
    display: 'flex',
    flexDirection: 'column',
    justifyContent: 'center',
    alignItems: 'center',
    minHeight: '100vh',
    backgroundColor: '#f5f5f5',
  },
  title: {
    fontSize: '32px',
    fontWeight: 'bold',
    marginBottom: '30px',
    color: '#333',
  },
  button: {
    backgroundColor: '#007AFF',
    padding: '12px 24px',
    border: 'none',
    borderRadius: '8px',
    cursor: 'pointer',
    boxShadow: '0 2px 4px rgba(0,0,0,0.25)',
  },
  buttonText: {
    color: '#fff',
    fontSize: '18px',
    fontWeight: '600',
  },
};

export default App;
